from MODELS.excel_file import *
import chardet, os
import numpy as np
import pandas as pd


def detectar_encoding(arquivo):
    with open(arquivo, "rb") as f:
        resultado = chardet.detect(f.read(1000))
        return resultado['encoding']
    
def detectar_delimitador(arquivo, enconding):
    with open(arquivo, "r", encoding=enconding) as f:
        primeira_linha = f.readline()
        if "\t" in primeira_linha:
            return "\t"
        elif ";" in primeira_linha:
            return ";"
        elif "," in primeira_linha:
            return ","
        
def convert_csv_to_xlsx(csv_file):

    if csv_file:
        excel_file = csv_file.replace(".csv",".xlsx")

        # Detectar enconding do arquivo
        enconding = detectar_encoding(csv_file)
        print(enconding)

        # Detectar o delimitador do arquivo
        delimitador = detectar_delimitador(csv_file,enconding)
        print(delimitador)

        # Ler o CSV com o encodnding e o delimitador
        try:   
            df = pd.read_csv(csv_file,delimiter=delimitador,encoding=enconding)
        except UnicodeDecodeError:
            print("‚ö†Ô∏è Erro de decodifica√ß√£o com a codifica√ß√£o detectada, tentando com 'latin1'...")
            df = pd.read_csv(csv_file,delimiter=',',encoding='latin1')

        # Salvar em excel
        df.to_excel(excel_file,index=False)

    else:
        pass
        #print("‚ùå Nenhum arquivo selecionado")

def remove_duplicates(xlsx_file, type_table):

    if xlsx_file:
        no_dup_file = os.path.splitext(xlsx_file)[0] + "_no_dup.xlsx"
        print(f"üìÇ Arquivo selecionado: {xlsx_file}")

        # Ler a primeira planilha do Excel
        try:
            df = pd.read_excel(xlsx_file, sheet_name=0)  # L√™ a primeira aba
        except Exception as e:
            print(f"‚ö†Ô∏è Erro ao ler o arquivo Excel: {e}")
            return

        # Remover hyperlinks de todas as colunas de texto
        for col in df.select_dtypes(include=["object"]).columns:
            df[col] = df[col].str.replace(r"http\S+", "", regex=True)
        
        # Definir as colunas a serem usadas para remo√ß√£o de duplicatas
        colunas_para_comparacao_exp = [
            "university_id",
            "campus_id", 
            "name_from_university",
            "level",
            "kind",
            "shift",
            "enrollment_semester",
            "max_payments",
            "full_price"
            ]
        colunas_para_comparacao_msp = [
            "ID do Campus",
            "Nome do Curso",
            "Grau",
            "Modalidade",
            "Turno",
            "Dura√ß√£o do Curso",
            "Mensalidade sem desconto"
            ]

        # Escolhe as colunas certas conforme o tipo
        if type_table == "msp":
            colunas_para_comparacao = colunas_para_comparacao_msp
        elif type_table == "exp":
            colunas_para_comparacao = colunas_para_comparacao_exp
        else:
            print("‚ùå Tipo de tabela n√£o reconhecido.")
            return

        # Cria a coluna de chave √∫nica concatenada
        df['SKU'] = df[colunas_para_comparacao].astype(str).apply(
            lambda row: '_'.join(row.values), axis=1
        )

        # Remove duplicatas pela nova coluna
        df_no_dup = df.drop_duplicates(subset='SKU', keep='first')

        
        # Remove a coluna auxiliar
        df_no_dup = df_no_dup.drop(columns=['SKU'])

        # Salvar o DataFrame limpo em um novo arquivo Excel
        try:
            df_no_dup.to_excel(no_dup_file, index=False, engine='openpyxl')
            print(f"‚úÖ Arquivo salvo como: {no_dup_file}")
            xlsx_file=None
        except Exception as e:
            print(f"‚ö†Ô∏è Erro ao salvar o arquivo Excel: {e}")

    else:
        print("‚ùå Nenhum arquivo selecionado")

