def levenshtein_distance(s1, s2):
    """Calcula a Dist√¢ncia de Levenshtein entre duas strings."""
    len_s1, len_s2 = len(s1), len(s2)
    dp = np.zeros((len_s1 + 1, len_s2 + 1), dtype=int)

    # Inicializa a matriz
    for i in range(len_s1 + 1):
        dp[i][0] = i
    for j in range(len_s2 + 1):
        dp[0][j] = j

    # Preenche a matriz
    for i in range(1, len_s1 + 1):
        for j in range(1, len_s2 + 1):
            if s1[i - 1] == s2[j - 1]:  
                cost = 0  
            else:
                cost = 1  
            
            dp[i][j] = min(dp[i - 1][j] + 1,      # Remo√ß√£o
                        dp[i][j - 1] + 1,      # Inser√ß√£o
                        dp[i - 1][j - 1] + cost)  # Substitui√ß√£o
    
    return dp[len_s1, len_s2]

def find_closest_match(word, word_list):
    """ Encontrar se a palavra existe na lista"""
    for cidades in word_list:
        if word == cidades:
            print("saida1")
            return word
    
    """Se n√£o encontra na lista, encontra a palavra mais pr√≥xima dentro de uma lista usando Levenshtein Distance."""
    closest_word = None
    min_distance = float('inf')

    for candidate in word_list:
        distance = levenshtein_distance(word.lower(), candidate.lower())
        if distance < min_distance:
            min_distance = distance
            closest_word = candidate

    if closest_word.lower() == word.lower():
        return word
    else:
        return closest_word

